import React from "react";
import "./chefsCards.css";
import chefsData from "../../../chefs-data.json";
import ChefCard from "../chefCard/ChefCard";
import finalData from "../../../dataFinal.json";
import { json } from "stream/consumers";

interface Idata{
    restaurants: object[],
    chefs: object[]
}

interface Ichef{
    name: string,
    img: string
}

const ChefsCards: React.FC = ()=>{
    const data:Ichef[] = chefsData as Ichef[];
    return(
        <div id="chefs-cards-container">
            <p>{finalData}</p>
            {data.map((chef:Ichef)=>( <ChefCard 
                name={chef.name}
                img= {chef.img}/>
            ))}
        </div>
    );
}

export default ChefsCards;
